import ajax from '../ajax'
const BASE = '/admin/train'

// 获取站点列表
export const getSiteList = () => ajax(BASE + '/getSiteList')
// 获取车厢列表
export const getCarriageList = () => ajax(BASE + '/getCarriageList')
// 添加车次
export const addTrain = () => ajax(BASE + '/add', {}, 'POST')
